"use client"

import { useState, useEffect } from "react"
import { Link } from "react-router-dom"
import { fetchUniversityData } from "../services/universityService"

function Dashboard() {
  const [universities, setUniversities] = useState([])
  const [loading, setLoading] = useState(true)
  const [error, setError] = useState("")

  useEffect(() => {
    async function loadData() {
      try {
        const data = await fetchUniversityData()
        setUniversities(data)
        setLoading(false)
      } catch (err) {
        setError("Failed to load university data")
        setLoading(false)
      }
    }

    loadData()
  }, [])

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="text-xl font-semibold">Loading...</div>
      </div>
    )
  }

  if (error) {
    return <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded">{error}</div>
  }

  return (
    <div>
      <div className="mb-8 text-center">
        <h1 className="text-3xl font-bold mb-4">UK University Finder</h1>
        <p className="text-lg mb-6">Find the perfect university for your academic journey</p>
        <Link
          to="/questionnaire"
          className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-3 px-6 rounded-lg text-lg"
        >
          Start University Recommendation Quiz
        </Link>
      </div>

      <div className="mt-12">
        <h2 className="text-2xl font-semibold mb-4">Featured Universities</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {universities.slice(0, 6).map((university, index) => (
            <div key={index} className="bg-white rounded-lg shadow-md overflow-hidden">
              <div className="h-40 bg-gray-200 flex items-center justify-center">
                <span className="text-gray-500 text-lg">University Image</span>
              </div>
              <div className="p-4">
                <h3 className="text-xl font-semibold mb-2">{university.Name}</h3>
                <p className="text-gray-600 mb-2">Location: {university.Location}</p>
                <p className="text-gray-600 mb-2">Ranking: {university.Ranking}</p>
                <Link
                  to={`/university/${index}`}
                  className="mt-2 inline-block bg-blue-500 hover:bg-blue-700 text-white py-2 px-4 rounded"
                >
                  View Details
                </Link>
              </div>
            </div>
          ))}
        </div>

        <div className="mt-8 text-center">
          <p className="text-lg mb-4">Want personalized recommendations?</p>
          <Link to="/questionnaire" className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded">
            Take Our Questionnaire
          </Link>
        </div>
      </div>
    </div>
  )
}

export default Dashboard
